import React, { useEffect, useState } from 'react';
import './addcustomer.css';
import Sidebar from '../Sidebar/sidebar';
import { useLocation, useNavigate, useParams } from 'react-router-dom';
import axios from 'axios';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

interface CustomerData {
  fullName: string;
  address: string;
  contactDetail: number;
}

function AddCustomer() {
  const BASE_URL = process.env.REACT_APP_API_BASE_URL;
  const navigate = useNavigate();
  const location = useLocation();
  const customerId = location.state?.id;  // Retrieve customerId from location state


  const [customerData, setCustomerData] = useState<CustomerData>({
    fullName: '',
    address: '',
    contactDetail: 0,
  });

  useEffect(() => {
    // Fetch customer data if customerId is provided (for editing)
    if (customerId) {
      axios.get(`${BASE_URL}customer/${customerId}`)
        .then((response) => {
          setCustomerData(response.data);
        })
        .catch((error) => {
          console.error('Error fetching customer data:', error);
          toast.error('Failed to load customer data');
        });
    }
  }, [customerId]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setCustomerData({
      ...customerData,
      [name]: name === 'contactDetail' ? parseInt(value, 10) : value,
    });
  };

  const handleSubmit = async (event: React.FormEvent) => {
    event.preventDefault();

    if (!customerData.fullName.trim()) {
      toast.error('Full Name is required');
      return;
    }
    if (!customerData.address.trim()) {
      toast.error('Address is required');
      return;
    }
    if (!customerData.contactDetail) {
      toast.error('Contact Detail is required');
      return;
    }

    try {
      if (customerId) {
        await axios.put(`${BASE_URL}customer/${customerId}`, customerData);
        toast.success('Customer updated successfully');
      } else {
        await axios.post(`${BASE_URL}customer`, customerData);
        toast.success('Customer added successfully');
      }
     
    setTimeout(() =>{
      navigate('/manageCustomer');

    },1000)

    } catch (error) {
      console.error('Error saving customer:', error);
      toast.error('Failed to save customer');
    }
  };

  return (
    <>
      <Sidebar />
      <ToastContainer position="top-right" autoClose={3000} />

      <div className="d-flex justify-content-center align-items-center" style={{ height: '100vh' }}>
        <div className="ps-4 customerbox">
          <div className="d-flex align-items-center">
            <i className="bi bi-arrow-left backicon" onClick={() => navigate('/manageCustomer')}></i>
            <span className="order">{customerId ? 'Edit Customer' : 'Add Customer'}</span>
          </div>

          <form onSubmit={handleSubmit}>
            <div className="heading mt-2">Full Name</div>
            <input
              type="text"
              name="fullName"
              className="form-control mt-2"
              value={customerData.fullName}
              onChange={handleChange}
            />

            <div className="heading">Address</div>
            <input
              type="text"
              name="address"
              className="form-control mt-2"
              value={customerData.address}
              onChange={handleChange}
            />

            <div className="heading">Contact Number</div>
            <input
              type="text"
              name="contactDetail"
              className="form-control mt-2"
              value={customerData.contactDetail}
              onChange={handleChange}
            />

            <div className="d-flex justify-content-end mt-4">
              <button type="submit" className="btn btn-primary">
              {customerId ? 'Update' : 'Save'}
              </button>
              <button
                type="button"
                className="btn btn-primary ms-2"
                onClick={() => navigate('/manageCustomer')}
              >
                Cancel
              </button>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default AddCustomer;
